import { Fantasy } from "../../components/fantasy";
import { Crime } from "../../components/films/crime";

export const Home = () => {
    return (
    <div>
    <h1>Home</h1>
    <h2>Fantasy</h2>
    <Fantasy />
    <h2>Crime</h2>
    <Crime />
    </div>
    );
};
